import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Data from "./Data";
import Example from "./Excample";



function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Data />} />
        <Route path="/chart" element={<Example />} />

      </Routes>
    </Router>
  );
}

export default App;
